import React, { useEffect, useState } from 'react';
//import { Link, withRouter } from 'react-router-dom';
import { getNyc } from '../actions/getNyc';
import { getGaurdian } from '../actions/getGaurdian';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';
import DataCard from './DataCard';
import { empty } from '../utilities/empty';

const DataView = ({ getNyc, getGaurdian, nyc }) => {
	useEffect(() => {
		getNyc();
		//getGaurdian();
	}, []);

	const intialState = { results: [] };

	const [results, setResults] = useState([]);

	if (typeof nyc === undefined) {
		return;
	} else if (nyc.hasOwnProperty('nyc')) {
		Object.entries(nyc.nyc).map(([key, value]) => {
			setResults((results: value));
		});
	}

	// Object.entries(nyc.nyc).map(item => {
	// 	console.log(item);
	// });

	// if (nyc) {
	// Object.entries(nyc.nyc).map(item => {
	// 	console.log(item);
	// });
	// }

	return <DataCard />;
};

DataView.propTypes = {
	getNyc: PropTypes.func.isRequired,
	getGaurdian: PropTypes.func.isRequired,
	nyc: PropTypes.object.isRequired
	//gaurdianData: PropTypes.object.isRequired
};
const mapStateToProps = state => ({
	nyc: state.nyc
	//: state.gaurdian.gaurdianData
});

export default connect(mapStateToProps, { getNyc, getGaurdian })(DataView);
